import React, { Component } from 'react';

/* function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello World</h1>
      </header>
    </div>
  );
} */

class Todo extends Component {
  render(){
    return(

      <div className="Todo">
      <header className="App-Todo">
        <h1>Hello World from Todo page</h1>
      </header>
     </div>

    );
  }
}

export default Todo;
